import LoginLeft from './MessageLogin'
import Login from './SingIn.js'
import CreateUser from './CreateUser';

function RenderAuth ({value}){
    if (value === 1){
        return(
            <div>
                <LoginLeft/> 
                <Login/>
            </div>
        );
    }else{
        return(
            <div>
                <LoginLeft/> 
                <CreateUser/>
            </div>
        );
    }
}
export default RenderAuth;
